# Function to decode geohash into bounding box


def decode_geohash(geohash):
    # Remove any suffix (e.g., "_0" or "_1")
    base_geohash = geohash.split("_")[0]

    # Decode to get the bounding box
    bounds = geohash2.decode_exactly(base_geohash)

    return {
        "geohash": geohash,
        "center_latitude": bounds[0],
        "center_longitude": bounds[1],
        "bounding_box": {
            "north": bounds[0] + bounds[2],  # latitude + lat_error
            "south": bounds[0] - bounds[2],  # latitude - lat_error
            "east": bounds[1] + bounds[3],   # longitude + lon_error
            "west": bounds[1] - bounds[3]    # longitude - lon_error
        }
    }


# Decode each geohash
decoded_geohashes = [decode_geohash(gh) for gh in geohashes]

